  marginLeft: 16,
  marginTop: 0,
};

const logoStyle = {
  fontSize: 20,
  fontWeight: "light",
};

const Header = () => (
  <div style={headerStyle}>
    <h1 style={logoStyle}>WINE手帳</h1>
    <Nav />
  </div>
);

export default Header;
